fields.script:
var pad = function (val) {
    return val > 9 ? val: "0" + val;
}
var fTime = function (time) {
    var m = Math.floor(time/60);
    var s = time % 60;
    return pad(m) + ":" + pad(s);
    }
var clsStopwatch = function () {
//public vars
this.key = 0;
this.timings = [];
this.running = false;
//private vars
var clocktimer;
var time = 0;
// Public methods
this.start = function () {
    var key = this.key;
	 localStorage.setItem('start' + key, new Date().getTime());
	 clocktimer = setInterval(function () {
      //display seconds elapsed
	   time = Math.floor(((new Date().getTime())-(localStorage.getItem('start' + key)))/1000);
      $("#timertext" + key).html(fTime(time));
      }, 1000);
    this.running = true;
}
// Stop, reset, record timing
this.stop = function () {
   var key = this.key;
   clearInterval(clocktimer);
   
	//record the time in an array
   this.timings.push(fTime(Math.floor(((new Date().getTime())-(localStorage.getItem('start' + key)))/1000)));
   var result = this.timings.join(", ");
   time = 0;
   $("#timertext" + key).html("00:00");
   $("#timings" + key).html(result);
   document.getElementById("19-timings_" + key).value = result;
   this.running = false;
   }
}

var timer0 =  new clsStopwatch();
var timer1 =  new clsStopwatch();
var timer2 =  new clsStopwatch();
var timer3 =  new clsStopwatch();
var timer4 =  new clsStopwatch();
var timer5 =  new clsStopwatch();

timer1.key = 1;
timer2.key = 2;
timer3.key = 3;
timer4.key = 4;
timer5.key = 5;
var timers = [timer0, timer1, timer2, timer3, timer4, timer5];

$(".timer").click(function () {
    var el = $(this);
    el.toggleClass("started");
    $(".toggletext", this).text(function (i, v) {
    return v === "STOP" ? "START": "STOP";
});

var mytimer = timers[el.data("key")];
    if (mytimer.running == false) {
    mytimer.start();
    } else {
    mytimer.stop();
    }
});

